import React, { Component } from 'react';
import "../styles/presentacion.css";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';
import Pagina1 from "../assets/Pag1_PRESENTACION_5.png";
import Pagina2 from "../assets/Pag2_PRESENTACION_5.png";
import Pagina3 from "../assets/Pag3_PRESENTACION_5.png";
import Pagina4 from "../assets/Pag4_PRESENTACION_5.png";
import Pagina5 from "../assets/Pag5_PRESENTACION_5.png";
import Pagina6 from "../assets/Pag6_PRESENTACION_5.png";
import Pagina7 from "../assets/Pag7_PRESENTACION_5.png";
import Pagina8 from "../assets/Pag8_PRESENTACION_4.png";
import Pagina9 from "../assets/Pag9_PRESENTACION_4.png";
import Pagina10 from "../assets/Pag10_PRESENTACION_4.png";
import Pagina11 from "../assets/Pag11_PRESENTACION_4.png";
import pdf from "../assets/manual de identidad corporativa.pdf"

class Presentacion4 extends Component {
    render() {
        return (
          <div className="contenedor_carrousel">
            <h1>Diseño Gráfico</h1>
            <Carousel
              className="crsl"
              autoPlay
              infiniteLoop
              centerMode
              interval={5000}
            >
                <div>
                    <img src={Pagina1} alt='Logotipo'/>
                </div>
                <div>
                    <img src={Pagina2} alt='Cartel Nerja'/>
                </div>
                <div>
                    <img src={Pagina3} alt='Cartel carnaval' />
                </div>
                <div>
                    <img src={Pagina4} alt='Tríptico rediseñado' />
                </div>
                <div>
                    <img src={Pagina5} alt='Manual identidad corporativa' />
                    <p className="legenda">
                    <a href={pdf} target="_blank" rel="noopener noreferrer" download="Manual_identidad_corporativa.pdf"> 
                      Descargar pdf
                    </a>
                    </p>
                </div>
                <div>
                    <img src={Pagina6} alt='Logotipo' />
                </div>
                <div>
                    <img src={Pagina7} alt='Wireframes en papel' />
                    <p className="legenda">
                    <a href={pdf} target="_blank" rel="noopener noreferrer" download="Manual_identidad_corporativa.pdf"> 
                      tipografía
                    </a>
                    </p>
                </div>
                <div>
                    <img src={Pagina8} alt='Wireframes digitales' />
                </div>
                <div>
                    <img src={Pagina9} alt='Prototipo de baja fidelidad' />
                    <p className="legenda">
                    <a href='https://www.figma.com/proto/kxZri2jN2PZP9qMBS6nvRh/Cachoper%C3%ADa?type=design&node-id=1-3&t=G4HCIFfMbfXy5D9U-1&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A3&mode=design' target="_blank" rel="noopener noreferrer">Prototipo de baja fidelidad</a>
                    </p>
                </div>
                <div>
                    <img src={Pagina10} alt='Estudio de usabilidad' />
                </div>
                <div>
                    <img src={Pagina11} alt='Prototipo de alta fidelidad' />
                    <p className="legenda">
                    <a href='https://www.figma.com/proto/kxZri2jN2PZP9qMBS6nvRh/Cachoper%C3%ADa?type=design&node-id=70-3739&t=yswE2BdcNLHyP4IP-1&scaling=scale-down&page-id=70%3A3737&starting-point-node-id=70%3A3739&mode=design' target="_blank" rel="noopener noreferrer">Prototipo móvil</a>
                    </p>
                    <p className="legendaa">
                    <a href='https://www.figma.com/proto/fzbWprPEHSuQ3l7Wp4hTYv/PARTIDOS-POL%C3%8DTICOS?node-id=166-1554&starting-point-node-id=166%3A1554&mode=design&t=NEFRsiGd9E6H3u0e-1' target="_blank" rel="noopener noreferrer">Prototipo pc</a>
                    </p>
                </div>
            </Carousel>
          </div>
        );
    }
};

export default Presentacion4;

